import React from "react";
import Header from "./Header";

const Contact = () => {
  return (
    <div className="contact">
      <Header />
      <h1 style={{ color: "white" }}>Contact Us</h1>
      <p style={{ color: "white" }}>
        If you have any questions, please feel free to reach out to us.
      </p>
    </div>
  );
};

export default Contact;
